import React from "react";
import { Nav } from "react-bootstrap";
import "./Navbar.css";
import { Link, animateScroll as scroll } from "react-scroll";
import Footer from "./Footer";

export default function Navbar() {
  const scrollToContact = () => {
    window.scrollTo({
      top: 5,
      behavior: "smooth",
    });
  };

  return (
    <div>
      <Nav className="navBar justify-content-end" activeKey="/home">
        <Nav.Item>
          <Nav.Link className="navItem" href="/home">
            Home
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="navItem" eventKey="about">
            About
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="navItem" eventKey="portfolio">
            Portfolio
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Link
            activeClass="active"
            to={Footer}
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            <Nav.Link className="navItem" eventKey="contact">
              Contact
            </Nav.Link>
          </Link>
        </Nav.Item>
      </Nav>
    </div>
  );
}
